const t='{% block sw_help_text %} <span v-tooltip="{ message: text, width: width, position: tooltipPosition, showDelay: showDelay, hideDelay: hideDelay }" class="sw-help-text" > {% block sw_help_text_icon %} <mt-icon name="solid-question-circle-s" /> {% endblock %} </span> {% endblock %}',l={template:t,props:{text:{type:String,required:!0,default:""},width:{type:Number,required:!1,default:200},tooltipPosition:{type:String,required:!1,default:"top",validValues:["top","bottom","left","right"],validator(e){return["top","bottom","left","right"].includes(e)}},showDelay:{type:Number,required:!1,default:100},hideDelay:{type:Number,required:!1,default:100}}};export{l as default};
